import { Question } from "./components/Question.js";
import { QuestionNavbar } from "../QuestionNavbar.js";

export const Study15 = () => {
  return (
    <div className="questions">
      <QuestionNavbar />
      <Question
        title={
          "Kun juttu on julkaistu, millaista keskustelua uskot tekemäsi jutun tuottavan?​​​​"
        }
        options={[
          {
            value: "Juttua ei huomioida ja keskustelua ei synny.​​",
            navigate: "info/16",
          },
          {
            value: "Juttu saa positiivista huomiota yleisöltä ja medialta.​​​",
            navigate: "info/17",
          },
          {
            value:
              "Juttu saa aikaan voimakkaita tunteita ja joudun häirinnän kohteeksi.​​",
            navigate: "info/18",
          },
        ]}
      />
    </div>
  );
};
